import React from "react";
import { Formik, Form } from "formik";
import { Container, Grid, Input, Button } from "@material-ui/core";

function App() {
  return (
    <div className='App'>
      <Container>
        <Grid>
          <Formik
            initialValues={{ file: "" }}
            onSubmit={async (values) => {
              console.log(values);
              let data = new FormData();
              await data.append("file", values.file);
              console.log(data);
            }}
          >
            {(formProps) => (
              <Form>
                <Grid>
                  <Input
                    type='file'
                    name='file'
                    onChange={(event) => {
                      formProps.setFieldValue("file", event.target.files[0]);
                    }}
                  ></Input>
                </Grid>
                <Grid>
                  <Input
                    type='file2'
                    name='file2'
                    onChange2={(event) => {
                      formProps.setFieldValue("file2", event.target.files[0]);
                    }}
                  ></Input>
                </Grid>
                <Button type='submit'>Submit</Button>
              </Form>
            )}
          </Formik>
        </Grid>
      </Container>
    </div>
  );
}

export default App;
